CREATE TABLE IF NOT EXISTS pc_part (
  id BIGINT PRIMARY KEY,
  name VARCHAR(255),
  description VARCHAR(255),
  image VARCHAR(20000),
  price DECIMAL(10,2),
  type VARCHAR(50)
);



